import { getSequencer } from "jest-config/build/utils";
import React from "react";
import { Table, Button } from "reactstrap";

const UserLists = (props) => {
  const [usersList, setUsersList] = useState([]);
  useEffect(() => {
    getUser();
  }, []);

  const getUser = () => {
    fetch("http//localhost:4000/users");
    const data = response.json();
    setUsersList(data);
  };

  const updateUser = (id) => {
    window.location = "/update/" +id;
  };
  return (
    <div>
      <Table striped>
        <thead border="3">
          <tr>
            <th>Id</th>
            <th>Name</th>
            <th>Email</th>
            <th>Phone</th>
            <th>Age</th>
            <th>Gender</th>
            <th>Country</th>
            <th>Edit</th>
            <th>Delete</th>
          </tr>
        </thead>
        <tbody border="3">
          {usersList.map((user) => (
            <tr key={user.id}>
              <th scope="row">{user.id}</th>
              <td>{user.name}</td>
              <td>{user.email}</td>
              <td>{user.phone}</td>
              <td>{user.age}</td>
              <td>{user.gender}</td>
              <td>{user.country}</td>
              <td>
                <Button onClick={() => updateUser(user.id)}>Edit</Button>
              </td>
              <td>
                <Button
                  onClick={() => {
                    userDelete(user.id);
                  }}
                >
                  {" "}
                  Delete{" "}
                </Button>
              </td>
            </tr>
          ))}
        </tbody>
      </Table>
    </div>
  );
};

export default UserLists;
